        We are a nationwide operator and franchisor of restaurants featuring fresh and fast made-to-order cuisine, including both Mexican inspired and American classic dishes. We are the second largest Mexican quick service restaurant ("QSR") by units with 547 Del Taco restaurants, a majority of these in the Pacific Southwest. We serve our customers high-quality food typical of fast casual restaurants but with the speed, convenience and value associated with traditional QSRs. With attributes of both a fast casual restaurant and a QSR, we occupy a place in the restaurant market distinct from our competitors. Our food is prepared in working kitchens where our customers see cooks grilling marinated chicken, chopping tomatoes and cilantro for salsa, grating cheddar cheese and slow cooking whole pinto beans. We are poised for growth, operating within the fastest growing segment of the restaurant industry, the limited 
service restaurant ("LSR") segment.
