We are an international high technology company engaged in a wide range of
programs throughout the world. We develop and supply a broad portfolio of
airborne, land and naval systems and products for defense, homeland security and
commercial aviation applications. Our systems and products are installed on new
platforms, and we also perform comprehensive platform modernization programs. In
addition, we provide a range of support services.

Our major activities include:

*military aircraft and helicopter systems;
*helmet mounted systems;
*commercial aviation systems and aerostructures;
*unmanned aircraft and unmanned surface vessels;
*land vehicle systems;
*command, control, communications, computer and intelligence (C4I) systems;
*intelligence and cyber systems;
*electro-optic and countermeasures systems;
*electronic warfare and signal intelligence systems; and
*various commercial activities.
Many of these major activities have a number of common and related elements.&nbsp;&nbsp;... More ...&nbsp;&nbsp;

