We are one of the largest integrated equipment services companies in the United
States focused on heavy construction and industrial equipment. We rent, sell and
provide parts and services support for four core categories of specialized
equipment: (1) hi-lift or aerial work platform equipment; (2) cranes;
(3) earthmoving equipment; and (4) industrial lift trucks. We engage in five
