 Microbot Medical is a medical device company specialized in the researching, designing, developing and commercializing of transformational micro-robotics medical technologies. 
Our vision is to improve the quality of life of millions of patients globally by advancing micro-robotic technologies to perform surgical procedures within the human body, and offer physicians and their patients less invasive and more precise solutions. The companyâ€™s innovations will tap into one of the fastest growing spaces in the medical field, the minimal invasive space, while continuously delivering devices that improve an individualâ€™s health, comfort and quality of life as well as providing added value to all other stakeholders.

