We are a diversified services and supply company that assists our clients in
sustaining, extending the service life, and improving the performance of their
transportation, equipment, and other assets and systems. We provide logistics
and distribution services for legacy systems and equipment and professional and
technical services to the United States Government (the "government"), including
the United States Postal Service ("USPS"), the United States Department of
Defense ("DoD"), federal civilian agencies, and to commercial and other
customers. Our largest customers are the USPS and the DoD. Our operations
include supply chain management solutions and parts supply for vehicle fleets;
maintenance, repair, and overhaul ("MRO") services and parts supply for aviation
clients; vehicle and equipment maintenance and refurbishment; logistics;
engineering; energy and environmental services; IT and health care IT solutions;
and consulting services.&nbsp;&nbsp;... More ...&nbsp;&nbsp;

    Westmoreland Coal Company began mining in Westmoreland County, Pennsylvania in 1854 as a Pennsylvania corporation. In 1910, we incorporated in Delaware and continued our focus on underground coal operations in Pennsylvania and the Appalachian Basin. We moved our headquarters from Philadelphia, Pennsylvania to Colorado in 1995. Today, we are an energy company with 13 coal mines in the western U.S. and Canada, a stake in an activated carbon plant and char production facility and two coal-fired power generation units. Our headquarters are located in Englewood, Colorado and we have approximately 2,900 employees.

    We believe we are now the sixth largest North American coal producer (as measured by 2013 production of nearly 52 million tons, including Sherritt 2013 production), and we believe that we are the largest dragline operator among North American coal producers with 29 draglines owned or operated.
